import React from 'react';
import Pation from './Pation';
import Apointment from './Appointment';
import Drug from './Drug';


function Navbar() {
  return (
<div className="photo">
<nav>
<div className="logo">
<i class="fas fa-heartbeat"></i>
<h4> health</h4>
</div>
<ul className="navlinks">
     <li className="link"><a href="#">patient</a></li>
     <li className="link"><a  href="#">home</a></li>
     <li className="link"><a  href="#">appointement</a></li>
     <li className="link"><a href="#">drug</a></li>
      <li className="link"><a className="logout" href="#">Logout</a></li>


</ul>
<div className="humburger-toggle">
<i class="fas fa-bars fa-lg"></i>
</div>
</nav>
</div>
  );
}

export default Navbar;
